import { useState , useRef ,useEffect} from 'react';
import './Flight.css';

const Flight =(props)=>{
    return(
        <div className="card">
        <div className="card-header">
         
            <span className="letter">Location: {props.name}</span>
          <div className="card-title-group">
            <h5 className="card-title">Mainland {props.category}</h5>
          </div>
        </div>
        <img className="card-image" src={props.image}  alt="Logo" />
        <div className="card-text">test</div>
        <div className="card-like-bar">
      
          <div className="like-text">
            <b>test</b> kişi bu tarifi beğendi.
          </div>
        </div>
      </div>
    )

}

export default Flight;
